import * as React from 'react';
import { View, Text} from 'react-native';
import { Button } from 'react-native-web';


function BreakfastScreen({navigation}) {
    return (
      <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
        <Text>Category</Text>
        <div className="App">
          <input type="text" placeholder="Search Pancake" style={{flexDirection:'row', borderWidth:10,borderRadius:8,paddingHorizontal:10,paddingVertical:10,}} />
        </div>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
      </View>
    );
}
export default BreakfastScreen;
